selected_var) {\n        min_change_value = Math.min(min_change_value, change_data[i]);\n        max_change_value = Math.max(max_change_value, change_data[i]);\n        var greater_abs_value = Math.max(Math.abs(min_change_value), Math.abs(max_change_value));\n        if (flipColorScaleMetrics.includes(selected_var)) {\n          min_change_value = greater_abs_value;\n          max_change_value = -greater_abs_value;\n        }\n        else{\n          min_change_value = -greater_abs_value;\n          max_change_value = greater_abs_value;\n        }\n    }\n}\n\nfor (var j = 0; j &lt; selected_player_indices.length; j++) {\n    var selected_player = players[selected_player_indices[j]];\n    var lineColor = player_colors[j % player_colors.length];\n\n    var x_values = [];\n    var y_values = [];\n    var display_values = [];\n    var display_dates = [];\n    var opponents = [];\n    var results = [];\n    var games = [];\n\n    for (var i = 0; i &lt; all_data_line['x'].length; i++) {\n        if ((all_data_line['Metric'][i] == selected_var) &amp;&amp; (all_data_line['Player'][i] == selected_player)) {\n            x_values.push(all_data_line['x'][i]);\n            y_values.push(all_data_line['y'][i]);\n            display_values.push(all_data_line['y'][i]);\n            display_dates.push(all_data_line['x'][i]);\n            opponents.push(all_data_line['Opponent'][i]);\n            results.push(all_data_line['Result'][i]);\n            games.push(all_data_line['Game'][i]);\n        } else {\n            x_values.push(NaN);\n            y_values.push(NaN);\n            display_values.push(NaN);\n            display_dates.push(NaN);\n            opponents.push(NaN);\n            results.push(NaN);\n            games.push(NaN);\n        }\n    }\n\n    new_data_line['x'] = new_data_line['x'].concat(x_values);\n    new_data_line['y'] = new_data_line['y'].concat(y_values);\n    new_data_line['display_value'] = new_data_line['display_value'].concat(display_values);\n    n
